import React from 'react';
import Pokedex from './Pokedex';
import data from './data'

function App() {
  return (
    <div className="App">
      <h1>Pokedex</h1>
      {data.map((element) => { // Javascript vem dentro de chaves
        <div key={element.id}>
          {console.log(element.name)}
        </div>
      })}
    </div>
  );
}

export default App;
